#include <iostream>

const char data[] = R"(




)";

const char pad[5][5] = {
	{  0,  0,'D',  0,  0},
	{  0,'A','B','C',  0},
	{'5','6','7','8','9'},
	{  0,'2','3','4',  0},
	{  0,  0,'1',  0,  0},
}; 

int main() {
  int x = 0, y = 2;
  for(auto c : data) {
    switch(c) {
       case 'R': if(x<4 && pad[y][x+1]) x++; break;
       case 'L': if(x>0 && pad[y][x-1]) x--; break;
       case 'U': if(y<4 && pad[y+1][x]) y++; break;
       case 'D': if(y>0 && pad[y-1][x]) y--; break;
       case '\n': std::cout << pad[y][x]; break;
       case '\0': std::cout << std::endl; break;
       default: std::cerr << "Unhandeled input " << (int)c << std::endl;
    }
  }
  return 0;
}